package amit.springframework.amitpetclinic_New.model;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import javax.persistence.MappedSuperclass;import java.io.Serializable;/** * Simple JavaBean domain object with an id property. Used as a base class for objects needing this property. *//** * created by KUAM on 4/18/2020 */@Getter@Setter@NoArgsConstructor@AllArgsConstructor@MappedSuperclasspublic class BaseEntity implements Serializable {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;}